import React from 'react'
import video from './components/Assets/bgvid.860475ab.mp4';
import ReactPlayer from 'react-player'

const Video = () => {
    return (
        <div>
            <ReactPlayer  controls url='https://www.youtube.com/watch?v=7sDY4m8KNLc' />
        </div>
    )
}

export default Video
